import React, { StrictMode } from 'react'
import PropTypes from 'prop-types'
import { hot } from 'react-hot-loader'

class CrosswordApp extends React.Component {
    constructor (props) {
        super(props)
    }

    render () {
        return (
            <StrictMode>
                <div>THIS IS A SIZING TEST</div>
                <div>HERE IS A SECOND TEST</div>
                <div>AND MAYBE A THIRD ONE</div>
            </StrictMode>
        )
    }
}

CrosswordApp.propTypes = {
    api: PropTypes.func.isRequired
}

export default hot(module)(CrosswordApp)
